import React from 'react';
import logo from './Yorkshire-Water-logo.jpg';
import './App.css';
import {Button} from 'react-bootstrap';
import {Tab} from 'react-bootstrap';
import {Tabs} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Tabs defaultActiveKey="profile" id="uncontrolled-tab-example">
      <Tab eventKey="profile" title="Model">
    <div>
    <div>
        <img src={logo} alt="logo" width="400" height="200"/>
    </div>

    <div class = "central-container">
        <style type="text/css">
          {`.btn-xxl {
            padding: 2rem 3rem;
            font-size: 2rem;
          }
          `}
        </style>

        <Button variant="outline-primary" size="xxl">
          Data Input
        </Button>

        <img src="https://img.icons8.com/officel/16/000000/arrow.png" width="300" height="100"/>

        <Button variant="outline-primary" size="xxl">
          Run Model
        </Button>

        <img src="https://img.icons8.com/officel/16/000000/arrow.png" width="300" height="100"/>

        <Button variant="outline-primary" size="xxl">
          Get Results
        </Button>
    </div>

    <div class = "lower-container"> 
          <style type="text/css">
            {`.btn-xxl {
              padding: 2rem 3rem;
              font-size: 2rem;
            }
            `}
          </style>
          <Button variant="outline-primary" size="xxl">
          Update Sheets
          </Button>
    </div>
    </div>
    </Tab>
    <Tab eventKey="contact" title="Parameters">
    </Tab>

    </Tabs>


);
}

export default App;
